  return "Page 1 loaded";
};

const Page2 = () => {
  return "Page 1 loaded";
};

const Page3 = () => {
  return "Page 1 loaded";
};

const App = () => {
  return (
    <Router>
      <Route path="/">
        <Page1 />
      </Route>
    </Router>
  );
};

ReactDom.render(<App />, document.getElementById("root"));
